            }
            else {
                if (winChanceOfStand(playerSum, dealerUpCard) > winChanceOfHit(playerSum, dealerUpCard, false))
                {
                    response = MoveAction.Stand; // stand
                }
                else {
                    if (winChanceOfDoubleHit(playerSum, dealerUpCard) > 0.505)
                    {
                        response = MoveAction.Double; // double
                    }
